import React from "react";
import "./PortfolioCard.css";

const PortfolioCard = ({ image, title, url, info }) => {
  return (
    <div className="PortfolioCard">
      <a href={url} add target="_blank">
        <img src={image} alt={title} />
      </a>
      <h3>
        <a href={url} add target="_blank">
          >{title}
        </a>
      </h3>
      <p>{info}</p>
    </div>
  );
};

export default PortfolioCard;
